import Axios from 'axios';
import React, {useState} from 'react';
import './App.css';

function App(props) {
  const [state, setstate] = useState([])

  Axios.get("http://localhost:8080/chat/rooms")
  .then(response=>{
    setstate(response.data)
  })

  return (
    <div className="App">
        <h1>Hey, there!</h1>
        <div>{state.map(p=><h4>{p.name}</h4>)}</div>
        <input type="text"/>

    </div>
  );
}

export default App;
